import Map from "./Map";
import styled from "styled-components";

const MapBox = styled.div`
  height: 21rem;
  width: 100%;
  align-items: center;
`;

const MapTemplate = () => {
  return (
    <MapBox>
      <Map />
    </MapBox>
  );
};

export default MapTemplate;
